INSERT INTO `wp_posts` VALUES('57', '3', '2015-04-03 09:55:46', '2015-04-03 09:55:46', '&nbsp;\r\n\r\n<a href=\"http://boogiemeister.com/wp-content/uploads/2015/04/boogiemeister_SummerTour.jpg\"><img class=\"alignnone size-full wp-image-210\" src=\"http://boogiemeister.com/wp-content/uploads/2015/04/boogiemeister_SummerTour.jpg\" alt=\"\" width=\"851\" height=\"315\" /></a>\r\n\r\n<strong>2017 Events ::  </strong>\r\n<div>August:  Bogota, Medellin gigs TBA</div>\r\n<div>July 19th: Havana, Cuba @ \"Mas Habana\" Club</div>\r\n<div>July 10th: Havana, Cuba @ Flauta Magica Rooftop Party</div>\r\n<div>July 9th:  Havana, Cuba @ \"Mas Habana\" Club</div>\r\n<div>July 8th:  Havana, Cuba @ Mexican Embassy Fiesta!</div>\r\n<div>June 21st:   Radio Show DJ set @  WFMU - NYC</div>\r\n<div>June 19th:  Bembe Club - NYC</div>\r\n<div>June 17th: Mermaid Parade After-Party @ Gemini Scorpio Loft - NYC</div>\r\n<div>June 3rd:  Subsuelo -  Los Angeles, CA</div>\r\nRemix The Earth monthly residency:   Maui, Hawaii\r\n\r\n<strong>2016 Events ::</strong>\r\n\r\nSeptember 28th: Underground Nomads night @ 1192 Folsom\r\n\r\nSeptember 26th:  Smoked Out Soul @ The Monarch - San Francisco, CA\r\n\r\nSeptember 18th-22nd:    Symbiosis Festival near Sacramento, California\r\n\r\nRemix The Earth monthly residency:   Maui, Hawaii\r\n\r\nJanuary 1st:  NYE party on Maui, Hawaii\r\n\r\n<strong>2015 Events ::</strong>\r\n\r\nOctober 31st:  HallowBaloo Fest block party; Honolulu, HI\r\n\r\nOctober 30th: <span style=\"font-size: 12px;\"> </span>Kailua Love Farmers Market event ; Oahu, HI\r\n\r\nOctober 29<span style=\"font-size: 12px;\">th:  </span>RAW Honolulu Showcase @ Hawaiian Brians; Honolulu, HI\r\n\r\nJune 8th: Ecstatic Dance;  Sacramento, CA\r\n\r\nJune 7th:  Ecstatic Dance; Nevada City, CA\r\n\r\nJune 4th: Elbo Room “Afrolicious” weekly;  San Francisco, CA\r\n\r\nMay 23rd:  Re-Bar;  Seattle, WA\r\n\r\nMay 3rd:  Garden Temple;  Puna, HI (Big Island)\r\n\r\nMay 2nd:  Hawaiian Sanctuary; Puna, HI (Big Island)\r\n\r\nApril 30th:  Garden Temple;  Puna, HI (Big Island)\r\n\r\nApril 20<sup>th</sup>: Remix The Earth party w/The Luminaries @ Casanova; Maui, HI\r\n\r\nMarch 22<sup>nd</sup>: Remix The Earth party w/Dragonfly @ Casanova; Maui, HI\r\n\r\nFebruary 21<sup>st</sup>: Remix The Earth party w/Jeremy Sole @ Casanova; Maui, HI\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n<strong>Event History ::</strong>\r\n\r\n2002 –2008: Tribal Harmonix Collective parties in British Columbia, Canada\r\n\r\n2003: Seattle Oracle Gathering 2 big legendary rave events\r\n\r\n2004-2008: Beats Without Borders monthly residency in Vancouver, BC\r\n\r\n2006/2007: Goa, India 3 gigs ; Poland 1 gig, Amsterdam 1 gig\r\n\r\n2009: Thailand 2 gigs\r\n\r\n2009-current: Countless shows up &amp; down the West Coast &amp; homeBASS in Hawaii', 'Gigs', '', 'publish', 'closed', 'open', '', 'gigs', '', '', '2017-08-04 18:05:46', '2017-08-04 18:05:46', '', '0', 'http://boogiemeister.com/?page_id=57', '0', 'page', '', '0');
