INSERT INTO `wp_posts` VALUES('114', '3', '2017-08-04 17:59:49', '2017-08-04 17:59:49', '<p style=\"text-align: left;\"><strong>BOOGIEMEISTER</strong> produces &amp; spins House, Global Bass, Future Funk, Moombahton, Electro-Swing &amp; then some, with the focus always on FUN &amp; making people BOOGIE with the magic of music!  His new live set is stirring up crowds featuring live drum kit, synth &amp; more cowbells!</p>\n<p style=\"text-align: center;\"><b>For booking inquiries contact booking agency ::  bioniclove@gmail.com  </b></p>\n&nbsp;\n\n<a href=\"http://boogiemeister.com/wp-content/uploads/2015/04/boogiemeister_SummerTour.jpg\"><img class=\"size-full wp-image-210 aligncenter\" src=\"http://boogiemeister.com/wp-content/uploads/2015/04/boogiemeister_SummerTour.jpg\" alt=\"\" width=\"851\" height=\"315\" /></a>\n\n&nbsp;\n\n<strong>VIDEOS ::</strong>\n\nBoogiemeister created this video while in Havana, Cuba.  *Music by Willie Colon – “Barrunto” (TropKillaz remix)\n\nhttps://youtu.be/Ox33sr8-aTQ\n\nBoogiemeister remix of bossa nova classic, filmed &amp; edited by Boogiemeister in Rio de Janeiro!\n\n&nbsp;\n\nBoogiemeister video feat. original audio samples &amp; video from Morocco trip!\n\nhttps://youtu.be/5ACyDHk_Bp4\n\nBoogiemeister video of original song \"Pachamama\" (global/latin House)\n\nhttps://youtu.be/C2mMLHOk4yM', '', '', 'inherit', 'open', 'open', '', '2-autosave-v1', '', '', '2017-08-04 17:59:49', '2017-08-04 17:59:49', '', '2', 'http://boogiemeister.com/?p=114', '0', 'revision', '', '0');
