INSERT INTO `wp_posts` VALUES('129', '3', '2015-06-01 18:44:19', '2015-06-01 18:44:19', '*BOOGIEMEISTER tunes on SoundCloud now have over 21k Plays, 512 Downloads, 204 Likes in 47 Countries!  \"Dirty Paws (Boogiemeister remix)\" is still making waves in the Tropical House scene with 11,000 plays!  Hootenanny!   <a href=\"http://www.soundcloud.com/Boogiemeister\" target=\"_blank\" rel=\"nofollow\">www.SoundCloud.com/Boogiemeister</a>\n\n///////////////////////////////////////////////////////////////////////////////////////////////////////////////\n\nBoogiemeister, aka BiOniC LoVe SoUnDsySteM, are the two musical projects of Adrian Blackhurst.  He has been producing music since the year 2000, with over 40+ songs on his discography, 2 full length albums &amp; 3 EPs. He DJs &amp; organizes music events on Maui with his Beats Bazaar nights. Back in 2004 he co-founded Beats Without Borders monthly (global fusion dance parties in Vancouver, BC that just had 10<sup>th</sup> anniversary!) &amp; band Delhi 2 Dublin (who have gone on to be quite a successful popular band). In November 2014 he launched “Remix The Earth”, an ongoing music, travel &amp; video project spanning the globe. He uses the almighty laptop and plays bass, guitar, synths, melodica, &amp; various percussion. His debut full length album \"EthnosonicSUBfunk Theories\" was released July 2008 - an album exploring genres such as Global Beats, Dub, Breakbeats &amp; gypsytronica - withinstruments from India, Persia, Korea, &amp; Japan.\n\nBoogiemeister produces &amp; spins Global Beats, House, Future Funk, Moombahton, Electro-Swing &amp; Gypsy Breakbeats, Rock n\'Rolltronica &amp; then some, with the focus always on FUN &amp; making people BOOGIE with the magic of music! His previous project, Bionic Love Soundsystem, focused on the sounds of global &amp; dubwise electronica, infusing the sacred &amp; mystical of the East, with the block rockin\' beats of the West! Either way, get ready to DANCE! Listen to his tunes on SoundCloud (link below), including some free downloads &amp; mixes. His most recent tracks include “Pachamama”, “Summertime” &amp; others, to be released on upcoming Mucho Amor EP.\n\nIn 2007/08 he went on an epic globetrotting journey where he performed gigs on the beaches of Goa &amp; Mumbai India, Amsterdam, Vienna, Salzburg &amp; Krakow, as well as recording much of the EthnosonicSUBfunk Theories. He has shared the stages with artists such as Nickodemus, Cheb I Sabbah, Opiuo, Bassnectar, Bonobo, Afrolicious, Jef Stott, etc…and has performed at festivals up &amp; down the West Coast, from Canada to Baja California, including Vancouver Folk Festival, Seattle’s Oracle Gatherings, Forward Fest, Mystic Island Fest in Hawaii, Mystic Garden Gathering, Symbiosis, Get Freaky &amp; too many to list!\n\nAdrian is currently focusing on new live &amp; studio projects, and many gigs dj\'ing &amp; producing music events on Maui.  In January 2011 he launched Beats Bazaar productions on Maui, teamed up with Origins Music International &amp; together have organized 30+ shows the past few years in Hawaii, including an annual Dubapalooza Fest, Funkalicious night &amp; Remix The Earth series hosting artists such as Gaudi, Ganga Giri, Bluetech, Mad Professor, David Starfire, Nickodemus, The Funk Hunters etc..\n\nBeats Bazaar &amp; Origins Music Events   ::   <a href=\"http://www.Origins-BeatsBazaar.com\">www.Origins-BeatsBazaar.com</a>\n\nBoogiemeister has performed at Symbiosis, Burning Man 2006 &amp; 2011, Mystic Garden Gathering, Art-Mixx festival on Maui for audience of 3,000+ fans!!  From Cabo, Mexico to Vancouver BC, Poland to Thailand &amp; then some.\n<div class=\"text_exposed_show\">\n\noriginal tunes :: 52+ original free downloads including \"Dirty Paws (Boogiemeister remix)\" still making waves in the Tropical House scene with 11,000 plays!\n<a href=\"http://www.soundcloud.com/Boogiemeister\" target=\"_blank\" rel=\"nofollow\">www.SoundCloud.com/Boogiemeister</a>\n\n</div>\ndj mixes: <a href=\"http://www.mixcloud.com/Boogiemeister\">www.mixcloud.com/Boogiemeister</a>\n\nremix project:: <a href=\"http://www.RemixTheEarth.com\">www.RemixTheEarth.com</a>\n\nbuy music here ::\n\n<a href=\"https://bioniclovesoundsystem.bandcamp.com/\">https://bioniclovesoundsystem.bandcamp.com/</a>\n\nwww.boogiemeister.bandcamp.com\n\n<a href=\"http://www.Facebook.com/theBoogiemeister\">www.Facebook.com/theBoogiemeister</a>', 'Bio', '', 'inherit', 'open', 'open', '', '11-autosave-v1', '', '', '2015-06-01 18:44:19', '2015-06-01 18:44:19', '', '11', 'http://boogiemeister.com/?p=129', '0', 'revision', '', '0');
