INSERT INTO `wp_posts` VALUES('230', '3', '2017-12-31 01:04:30', '2017-12-31 01:04:30', '/*\nWelcome to Custom CSS!\n\nCSS (Cascading Style Sheets) is a kind of code that tells the browser how\nto render a web page. You may delete these comments and get started with\nyour customizations.\n\nBy default, your stylesheet will be loaded after the theme stylesheets,\nwhich means that your rules can take precedence and override the theme CSS\nrules. Just write here what you want to change, you don\'t need to copy all\nyour theme\'s stylesheet content.\n*/\nbody {\n	background: #4c8490;\n}\n\n.navbar {\n	background: #4c8490;\n}\n\n.site-content {\n	background: #4c8490;\n}', 'zerif-lite', '', 'inherit', 'closed', 'closed', '', '225-revision-v1', '', '', '2017-12-31 01:04:30', '2017-12-31 01:04:30', '', '225', 'http://boogiemeister.com/?p=230', '0', 'revision', '', '0');
INSERT INTO `wp_posts` VALUES('231', '3', '2017-12-31 01:04:30', '2017-12-31 01:04:30', '/*\nWelcome to Custom CSS!\n\nTo learn how this works, see http://wp.me/PEmnE-Bt\n*/\n*,\n:before,\n:after {\n	-webkit-box-sizing: border-box;\n	-moz-box-sizing: border-box;\n	box-sizing: border-box;\n}\n\nhtml {\n	height: 100%;\n}\n\nbody {\n	background: url(http://boogiemeister.com/wp-content/uploads/2015/04/Boogiemeister_ArtMixx_Feb2015_Fav.jpg);\n	background-size: cover;\n	color: whitesmoke;\n	position: relative;\n	margin: 0;\n	padding-bottom: 4rem;\n	min-height: 100%;\n}\n\n.header, .footer, .hentry {\n	background: rgba(0,0,0,0.75);\n}\n\n.footer {\n	position: absolute;\n	right: 0;\n	bottom: 0;\n	left: 0;\n	text-align: center;\n}\n\n#logo {\n	visibility: hidden;\n	position: relative;\n	width: 400px;\n	margin: 0 auto;\n}\n\n#logo:after {\n	display: block;\n	content: url(http://boogiemeister.com/wp-content/uploads/2015/04/logo-white-sm.png);\n	visibility: visible;\n	position: absolute;\n	top: 0;\n	left: 0;\n}\n\n.hentry {\n	border: none;\n	border-radius: 10px;\n}\n\n.hentry header {\n	border: none;\n}\n\n.hentry footer {\n	border: none;\n}\n\n@media (max-width: 767px) {\n	nav {\n		display: none;\n	}\n}\n\n@media (min-width: 768px) and (max-width: 1029px) {\n	nav {\n	/* Nothing now */\n	}\n	\n	ul#menu-main-menu {\n		width: 385px;\n		margin: 0 auto;\n	}\n}\n\n@media (min-width: 1030px) {\n	nav {\n	/* Nothing now */\n	}\n	\n	ul#menu-main-menu {\n		width: 385px;\n		margin: 0 auto;\n	}\n}', 'bones', '', 'publish', 'closed', 'closed', '', 'bones', '', '', '2017-12-31 01:04:30', '2017-12-31 01:04:30', '', '0', 'http://boogiemeister.com/?p=231', '0', 'custom_css', '', '0');
